package objects.fixed;

import objects.GameObject;
import java.io.*;
import java.util.Base64;
import java.util.zip.GZIPInputStream;

public final class ImportedOBJ extends GameObject {
    private static final int[][] EMPTY_EDGES = new int[0][];

    // Mesh data is stored as gzipped binary, Base64-encoded in chunks to avoid "code too large".
    private static final String[] MESH_B64 = {
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            "",
            ""
    };

    private static final Object DATA_LOCK = new Object();
    private static volatile ModelData DATA;

    private static ModelData data() {
        ModelData d = DATA;
        if (d != null) return d;
        synchronized (DATA_LOCK) {
            d = DATA;
            if (d != null) return d;
            try {
                d = readModel();
            } catch (IOException e) {
                throw new UncheckedIOException(e);
            }
            DATA = d;
            return d;
        }
    }

    private static ModelData readModel() throws IOException {
        try (DataInputStream in = new DataInputStream(openMeshStream())) {
            int partCount = in.readInt();
            String[] names = new String[partCount];
            double[][][] verts = new double[partCount][][];
            int[][][] faces = new int[partCount][][];
            double[][][] uvs = new double[partCount][][];
            for (int p = 0; p < partCount; p++) {
                names[p] = in.readUTF();
                verts[p] = readDouble2D(in);
                faces[p] = readInt2D(in);
                boolean hasUvs = in.readBoolean();
                uvs[p] = hasUvs ? readDouble2D(in) : null;
            }
            return new ModelData(names, verts, faces, uvs);
        }
    }

    private static InputStream openMeshStream() throws IOException {
        StringBuilder sb = new StringBuilder();
        for (String s : MESH_B64) sb.append(s);
        byte[] gz = Base64.getDecoder().decode(sb.toString());
        return new GZIPInputStream(new ByteArrayInputStream(gz));
    }

    private static double[][] readDouble2D(DataInputStream in) throws IOException {
        int rows = in.readInt();
        int cols = in.readInt();
        double[][] a = new double[rows][cols];
        for (int r = 0; r < rows; r++) {
            for (int c = 0; c < cols; c++) {
                a[r][c] = in.readDouble();
            }
        }
        return a;
    }

    private static int[][] readInt2D(DataInputStream in) throws IOException {
        int rows = in.readInt();
        int cols = in.readInt();
        int[][] a = new int[rows][cols];
        for (int r = 0; r < rows; r++) {
            for (int c = 0; c < cols; c++) {
                a[r][c] = in.readInt();
            }
        }
        return a;
    }

    private static final class ModelData {
        final String[] names;
        final double[][][] verts;
        final int[][][] faces;
        final double[][][] uvs;
        ModelData(String[] names, double[][][] verts, int[][][] faces, double[][][] uvs) {
            this.names = names;
            this.verts = verts;
            this.faces = faces;
            this.uvs = uvs;
        }
    }

    public ImportedOBJ() {
        // No-op (mesh data returned via overrides)
    }

    public ImportedOBJ(double x, double y, double z) {
        this();
        this.getTransform().position.x = x;
        this.getTransform().position.y = y;
        this.getTransform().position.z = z;
    }

    @Override public double[][] getVertices() {
        return data().verts[0];
    }

    @Override public int[][] getEdges() { return EMPTY_EDGES; }

    @Override public int[][] getFacesArray() {
        return data().faces[0];
    }

    @Override public double[][] getUVs() {
        return data().uvs[0];
    }

    @Override public void update(double delta) { }

}
